// ContactUsPage.js

import React from 'react';

const contributors = [
  { id: 1, name: 'Abhirudh B.N.', role: 'Role: blah blah', photo: '../CSS/default.jpeg' },
  { id: 2, name: 'Abhay A Rao', role: 'Role: blah blah', photo: '../CSS/default.jpeg' },
  { id: 3, name: 'Aadhya Darshan', role: 'Role: blah blah', photo: '../CSS/default.jpeg' },
];

const ContactUsPage = () => {
  return (
    <div>
      {/* Header */}
      <header className="header">
        <h1>Portfolionaire</h1>
      </header>

      {/* Navigation */}
      <div className="box">
        <nav className="navbar">
          <ul>
            <li>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <a href="./homepage.html">Home</a></li>
            <li><a href="#">Profiles</a></li>
            <li><a href="./ContactUsPage.html">Contacts</a></li>
          </ul>
          <div className="search">
            <input type="text" placeholder="Search..." />
            <input type="submit" value="Search" />
          </div>
          <ul>
            <li><a href="#">Login</a></li>
            <li><a href="#">Your Portfolio</a> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>
          </ul>
        </nav>
      </div>

      {/* Main Content */}
      <div id="about">
        <h3>Our Team</h3>
        <div className="team-members">
          {/* Display contributor objects */}
          {contributors.map((contributor) => (
            <div key={contributor.id} className="team-member">
              <img src={contributor.photo} alt={contributor.name} />
              <h4>{contributor.name}</h4>
              <p>{contributor.role}</p>
            </div>
          ))}
        </div>

        <h3>Contact Us</h3>
        <p>Collaboration starts with a conversation. Whether you have a project in mind, want to discuss opportunities, or just want to say hello, we are just a click away.</p>
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>Triple A Co.</p>
      </footer>
    </div>
  );
};

export default ContactUsPage;
